message: "<a href=https://waterloo-collection.ru/5747/>Награды Италии 1 Мировой войны — медаль за участие — купить</a>  Медаль, посвященная памяти за участие в 1 Мировой Войне (1914-1918 гг.) с 1915 по 1918 гг. Учреждена в 1920 году. Италия. Оригинал, подлинник. Хорошее коллекционное состояние. Галерея военного антиквариата Ватерлоо, широкий выбор наград Италии.  \r\n \r\nМагазин военного антиквариата Ватерлоо <a href=https://waterloo-collection.ru>waterloo-collection.ru</a>  Катаны, сабли, вакидзаси, мечи, шпаги, син-гунто, кай-гунто и многое другое"
